import React, { useState,use } from 'react'
import axios from 'axios'


export const View = () => {
    const [Data,setdata]=useState([''])

    useEffect(()=>{
   let fetchdata=async ()=>{
            let response=await axios.get('http://localhost:4000/find')
            console.log(response.Data);
            setdata(response.Data)
    }
    fetchdata()
},[])
console.log(Data);  

  return (
    <div classname='d-flex gap-3 mt-2'>



        {Data.map((item,index)=>(
        <div classname='gb-black text-white p-3'>
        <h2>Sl no. :{index}</h2>
        <h2>Username :{item.username} </h2>
        <h2>Password :{item.password}</h2>
        <h2>Firstname :{item.firstName}</h2>
        <h2>Lastname :{item.lastName}</h2>
        <h2>Type :{item.userType}</h2>
        </div>
        ))}
    </div>
  )
}
